import React, { Component } from "react";

export class DataTable extends Component {
  state = {
    data: this.props.data
  };


  render() {
    return (
      <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Age</th>
          <th>Eye color</th>
          <th>Gender</th>
          <th>Company</th>
          <th>Email</th>
          <th>Phone</th>
          <th>Address</th>
        </tr>
        </thead>
      </table>
    );
  }
}

export default DataTable;
